('node', 'page', 0, 13, 13, 'und', 0, '<p style="margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: normal;">&nbsp;</p><p style="margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: normal;">&nbsp;</p><p><img alt="" src="http://www.telcel.com/iphone4S/images/caract_desempeno.jpg" style="color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: normal; width: 363px; height: 399px; float: left;"></p><p style="margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: normal;">El procesador de iPhone más poderoso que haya existido. El chip Dual-Core A5 te brinda hasta dos veces más potencia y gráficos hasta siete veces más rápidos, notarás la diferencia rápidamente. iPhone 4S es rápido y receptivo: eso hace la diferencia al momento de ejecutar nuevas Apps , navegar la Web, jugar y hacer lo que quieras, lo podrás hacer durante un largo tiempo, dado que el chip A5 ahorra tanta energía que la batería de tu iPhone 4S tendrá una duración sorprendente.</p><p style="margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: normal;">&nbsp;</p><p style="margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif; font-size: small; line-height: normal;">El Sistema Operativo móvil más avanzado del mundo y el más fácil de usar. Con cada avance iOS vienen maneras, incluso más simples, de hacer todas las cosas. Eso es lo que hace que iOS se mantenga a años luz en comparación con todo el resto. iOS 5 incluso da un paso más adelante, acercando más de 200 nuevas funcionalidades a iPhone 4S. Estos son algunos de nuestros favoritos.</p>', '', 'full_html'),
('node', 'page', 0, 14, 14, 'und', 0, '<p>Iphone 4S</p><p><iframe allowfullscreen="" frameborder="0" height="315" src="//www.youtube.com/embed/kVqX40Z_znE" width="560"></iframe></p><p>Samsung Galaxy S5</p><p><iframe allowfullscreen="" frameborder="0" height="315" src="//www.youtube.com/embed/-XseHZyvGtg" width="560"></iframe></p><p>Htc Rezound 4G Lite</p><p><iframe allowfullscreen="" frameborder="0" height="315" src="//www.youtube.com/embed/qxaiSqFC-nQ" width="560"></iframe></p>', '', 'full_html');
INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 15, 15, 'und', 0, '<div>&nbsp;</div><table border="1" cellpadding="1" cellspacing="1" style="width: 500px;"><tbody><tr><td><p style="margin-top: 10px; margin-bottom: 10px; line-height: 19px; font-family: Arial, Helvetica, sans-serif; font-size: 13px;"><img alt="" src="http://cdn.morecellphone.com/content/2012/jpg/23.jpg" style="width: 140px; height: 200px; float: left;">El gran cambio en el iPhone 4S es su procesador&nbsp;<strong>Dual-Core</strong>&nbsp;que aporta más velocidad en el dispositivo.&nbsp;La memoria interna de&nbsp;<strong>16GB</strong>&nbsp;sigue siendo buena sin posibilidad de expansión.</p><p style="margin-top: 10px; margin-bottom: 10px; line-height: 19px; font-family: Arial, Helvetica, sans-serif; font-size: 13px;">El iPhone 4S ya cuenta con cámara de&nbsp;<strong>8 megapíxeles</strong>&nbsp;que toma fotos excelentes, tiene flash y graba&nbsp;<strong>videos en Full HD</strong>. La cámara secundaria del iPhone 4S no tenía cambio, se mantiene en baja resolución.</p><p style="margin-top: 10px; margin-bottom: 10px; line-height: 19px; font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Ahora el iPhone 4S tiene una pantalla táctil de 3.5 pulgadas con&nbsp;<strong>IPS Retina</strong>, dejando la imagen mejor.</p><p style="margin-top: 10px; margin-bottom: 10px; line-height: 19px; font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Otra novedad es el&nbsp;<strong>Siri</strong>, una asistente personal que responde a comandos de voz del usuario. El Siri es una avanzada aplicación que te sorprenderá.</p></td></tr></tbody></table><table border="1" cellpadding="1" cellspacing="1" style="width: 500px;"><tbody><tr><td><table cellpadding="0" cellspacing="6" class="tab_phone" style="margin-bottom: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;" width="100%"><tbody><tr class="cab"><td class="cabeca" style="padding: 11px; border-style: solid; border-color: rgb(255, 255, 255); color: rgb(255, 255, 255); font-weight: bold; background: rgb(102, 102, 102);">Modelo y Características Físicas</td><td style="padding: 11px; border-top-style: solid; border-bottom-style: solid; border-left-style: solid; border-color: rgb(255, 255, 255); color: rgb(255, 255, 255); font-weight: bold; background: rgb(102, 102, 102);">Apple iPhone 4S 16GB</td></tr><tr class="par"><td style="padding: 5px; border-style: solid; border-color: rgb(255, 255, 255); background: rgb(238, 238, 238);">Marca</td><td class="um_larg" style="padding: 5px; border-top-style: solid; border-bottom-style: solid; border-left-style: solid; border-color: rgb(255, 255, 255); width: 349px; background: rgb(238, 238, 238);"><a href="http://www.movilcelular.es/marcas/moviles/apple/1" style="color: rgb(34, 34, 34); text-decoration: underline; font-weight: bold;">Apple</a></td></tr><tr><td style="padding: 5px; border-style: solid; border-color: rgb(255, 255, 255); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">Modelo</td><td style="padding: 5px; border-top-style: solid; border-bottom-style: solid; border-left-style: solid; border-color: rgb(255, 255, 255); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><a href="http://www.movilcelular.es/movil/apple-iphone-4s-16gb/25" style="color: rgb(34, 34, 34); text-decoration: underline; font-weight: bold;">iPhone 4S 16GB</a></td></tr><tr class="par"><td style="padding: 5px; border-style: solid; border-color: rgb(255, 255, 255); background: rgb(238, 238, 238);">Tamb