('node', 'page', 0, 16, 16, 'und', 0, '<table border="1" cellpadding="1" cellspacing="1" style="width: 500px;"><tbody><tr><td><span style="box-sizing: border-box; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; height: 20px; line-height: 1.3em; font-weight: bold; text-decoration: underline; color: rgb(42, 90, 122);">Samsung Galaxy S5</span><br style="box-sizing: border-box; color: rgb(90, 90, 90); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span itemprop="description" style="box-sizing: border-box; color: rgb(90, 90, 90); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;">El&nbsp;<strong style="box-sizing: border-box;">Samsung Galaxy S5</strong>&nbsp;es la quinta generación del Galaxy S, esta vez conservando bastantes aspectos de diseño y hardware del Galaxy S4, pero agregando funcionalidades como monitor de ritmo cardíaco, sensor dactilar, y resistencia al agua. El Galaxy S5 posee una pantalla Super AMOLED 1080p de 5.1 pulgadas, cámara de 16 megapixels con flash LED y captura de video Ultra HD, 2GB de RAM, 16GB o 32GB de almacenamiento interno, ranura microSD, procesador quad-core a 2.5GHz, batería de 2800mAh, y corre Android 4.4 KitKat con la interfaz de Samsung, utilizando mejores materiales para su parte posterior en lugar del plástico brillante característico de las generaciones anteriores.</span></td></tr></tbody></table><table border="1" cellpadding="1" cellspacing="1" style="width: 500px;"><tbody><tr><td><table cellspacing="0" style="box-sizing: border-box; max-width: 100%; color: rgb(90, 90, 90); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><tbody style="box-sizing: border-b