n con redes sociales<br style="box-sizing: border-box;">- NFC&nbsp;<br style="box-sizing: border-box;">- Salida TV via MHL<br style="box-sizing: border-box;">- Cancelación activa de ruido con micrófono dedicado<br style="box-sizing: border-box;">- Reproductor de video MP4/DivX/XviD/WMV/H.264/H.263&nbsp;<br style="box-sizing: border-box;">- Reproductor de audio MP3/WAV/eAAC+/AC3/FLAC&nbsp;<br style="box-sizing: border-box;">- Organizador<br style="box-sizing: border-box;">- Editor de imagen/video<br style="box-sizing: border-box;">- Editor de documentos (Word, Excel, PowerPoint, PDF)<br style="box-sizing: border-box;">- Integración Google Search, Maps, Gmail, YouTube, Calendar, Hangouts, Drive, Play<br style="box-sizing: border-box;">- Memo/comandos/discado de voz<br style="box-sizing: border-box;">- Manoslibres incorporado<br style="box-sizing: border-box;">- Ingreso predictivo de texto</td></tr></tbody></table><table cellspacing="0" style="box-sizing: border-box; max-width: 100%; color: rgb(90, 90, 90); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><tbody style="box-sizing: border-box;"><tr style="box-sizing: border-box;"><th rowspan="3" scope="row" style="box-sizing: border-box; padding: 5px 6px; font-size: 12px; vertical-align: top; border: 0px; width: 125px; font-weight: 700; text-align: left; background-color: rgb(246, 246, 246);"><h3 style="color:blue;"><span style="color:#000000;"><em><strong>BATERÍA</strong></em></span></h3></th><td class="ttl" style="box-sizing: border-box; padding: 5px 6px; font-size: 12px; color: rgb(125, 116, 100); vertical-align: top; width: 100px; font-weight: 700;">&nbsp;</td><td class="nfo" style="box-sizing: border-box; padding: 5px 6px; font-size: 12px; color: rgb(64, 64, 64); vertical-align: top; border-right-width: 0px;">Standard, Li-Ion 2800 mAh</td></tr><tr style="box-sizing: border-box;"><td class="ttl" style="box-sizing: border-box; padding: 5px 6px; font-size: 12px; color: rgb(125, 116, 100); vertical-align: top; width: 100px; font-weight: 700;"><a href="http://www.smart-gsm.com/moviles/samsung-galaxy-s5#" style="box-sizing: border-box; color: rgb(125, 116, 100);">Stand-by</a></td><td class="nfo" style="box-sizing: border-box; padding: 5px 6px; font-size: 12px; color: rgb(64, 64, 64); vertical-align: top; border-right-width: 0px;">Hasta 390 h</td></tr><tr style="box-sizing: border-box;"><td class="ttl" style="box-sizing: border-box; padding: 5px 6px; font-size: 12px; color: rgb(125, 116, 100); vertical-align: top; width: 100px; font-weight: 700;"><a href="http://www.smart-gsm.com/moviles/samsung-galaxy-s5#" style="box-sizing: border-box; color: rgb(125, 116, 100);">Tiempo de conversación</a></td><td class="nfo" style="box-sizing: border-box; padding: 5px 6px; font-size: 12px; color: rgb(64, 64, 64); vertical-align: top; border-right-width: 0px;">Hasta 21 h</td></tr></tbody></table></td></tr></tbody></table><ol><li>&nbsp;</li></ol>', '', 'full_html');
INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 17, 17, 'und', 0, '<table border="1" cellpadding="1" cellspacing="1" style="width: 500px;"><tbody><tr><td><p style="margin-top: 10px; margin-bottom: 10px; line-height: 19px; font-family: Arial, Helvetica, sans-serif; font-size: 13px;">El&nbsp;<strong>HTC Rezound</strong>&nbsp;es un gran&nbsp;<strong>móvil Android</strong>&nbsp;con procesador de 1500Mhz e 2-cores que permite ejecutar juegos y aplicaciones pesadas.</p><p style="margin-top: 10px; margin-bottom: 10px; line-height: 19px; font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Con una ranura para tarjeta SIM, el HTC Rezound permite download hasta 100 Mbps para la navegación por Internet, pero esto también depende del operador móvil.</p><p style="margin-top: 10px; margin-bottom: 10px; line-height: 19px; font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Buena conectividad de este terminal que incluye Bluetooth Versión 3.0 con A2DP, WiFi 802.11 a/b/g/n, pero carece de conexión NFC.</p><p style="margin-top: 10px; margin-bottom: 10px; line-height: 19px; font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Terminal con 170 gramos incluyendo la batería. El móvil HTC Rezound es relativamente delgado con 13,65 mm de espesor.</p></td></tr></tbody></table><table border="1" cellpadding="1" cellspacing="1" style="width: 500px;"><tbody><tr><td><table cellpadding="0" cellspacing="6" class="tab_phone" style="margin-bottom: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;" width="100%"><tbody><tr class="cab"><td class="cabeca" style="padding: 11px; border-style: solid; border-color: rgb(255, 255, 255); color: rgb(255, 255, 255); font-weight: bold; background: rgb(102, 102, 102);">Modelo y Características Físicas</td><td style="